import Habitacion from "./components/Habitacion";

class App extends React.Component{
    render(){
        {for(var x = 0; x < 10; x++){
            habitaciones += <Habitacion num={x}/>
        }}
        return(
            <div className="row">
               {habitaciones}
            </div>
        )
    }
}

export default App;
